import React, { useEffect, useState } from 'react'
import "@styles/news_page.css";
import map from '@assets/map.svg';
import NewsSearchComp from '../components/newsSearchComp';
import Select from 'react-select'
import { useLocation } from 'react-router-dom';
import { useGetCryptosQuery } from '../services/cryptoApi';
import { useGetCryptoNewsQuery } from '../services/cryptoNewsApi';
import Loader from '../components/Loader';



const News = () => {
  const { pathname } = useLocation();

  const [newsCategory, setNewsCategory] = useState('Cryptocurrency');
  const { data } = useGetCryptosQuery(100);
  const { data: cryptoNews } = useGetCryptoNewsQuery({ newsCategory, count: 12 });

  let selectOptions = [];

  useEffect(() => {
    window.scrollTo(0, 0);
  }, [pathname]);
  
  useEffect(() => {
    data?.data?.coins?.map((currency) => {
      selectOptions.push({ value: currency.name, label: currency.name})
    })
  }, [data, newsCategory, cryptoNews])

  const changeSelectedOption = ({ value }) => {
    setNewsCategory(value)
  }
  

  if (!cryptoNews?.value) return <Loader />;

  return (
    <div className='news_page'>
      <div className="news_hero_section">
        <div className="news_inner_curved_rect"></div>
        <div className="news_outer_curved_rect"></div>
        <MAPSVG />
        {/* <img src={map} alt="map" className="news_map_img" /> */}
        <div className="news_search_wrapper">
          <Select onChange={changeSelectedOption} options={selectOptions} />
        </div>
      </div>
      <div className="newsResult_wrapper">
        <div className="newsResult_innerWrapper">
          {
            cryptoNews.value.map((news, i) => (
              <NewsSearchComp key={i} news={news} />
            ))}
        </div>
      </div>
    </div>
  )
}

export default News;


